sys_variable_value.value:
(function execute(inputs, outputs) {

var request = new sn_ws.RESTMessageV2();
request.setEndpoint(inputs.instance+'/api/1584389/cicd/'+inputs.action+'/'+inputs.RemoteId+'?'+inputs.queryParam);
request.setHttpMethod('GET');


var user = 'admin';
var password = gs.getProperty('x_601332_cicd.Remote.Instance.Password');

request.setBasicAuth(user,password);
request.setRequestHeader("Accept","application/json");

var response = request.execute();
var body=JSON.parse(response.getBody());

outputs.response=body;
outputs.status=response.getStatusCode();

if(response.getStatusCode()=='200'){

if(inputs.action=='commit'){
outputs.localupdatesetid=body.result.localUpdateSetId?body.result.localUpdateSetId.toString():'';
}
if(inputs.action=='preview_again' || inputs.action=='getRemoteSetDetails'){
outputs.remoteupdatesetid=body.result.remoteUpdateSetId?body.result.remoteUpdateSetId.toString():'';
outputs.inserted=body.result.inserted?body.result.inserted.toString():'0';
outputs.updated=body.result.updated?body.result.updated.toString():'0';
outputs.deleted=body.result.deleted?body.result.deleted.toString():'0';
outputs.total=body.result.total?body.result.total.toString():'0';
outputs.collisions=body.result.collisions?body.result.collisions.toString():'0';
outputs.loaded=body.result.loaded?body.result.loaded.toString():'';
}
}
})(inputs, outputs);

